        public static async Task<string> php(HttpListenerContext context, string path_)
        {
            string return_value = String.Empty;
            await Task.Factory.StartNew(() =>
            {
                if (File.Exists(path_))
                {
                    using (Process p = new Process()
                    {
                        StartInfo = new ProcessStartInfo()
                        {
                            FileName = "php",
                            Arguments = " \"" + path_ + "\"",
                            UseShellExecute = false,
                            RedirectStandardOutput = true,
                            RedirectStandardError = true,
                            CreateNoWindow = true
                        }
                    })
                    {
                        p.Start();
                        p.WaitForExit();
                        string stdout_ = p.StandardOutput.ReadToEnd();
                        string stderr_ = p.StandardError.ReadToEnd();
                        if (!String.IsNullOrEmpty(stdout_))
                        {
                            return_value = stdout_;
                        }
                        if (!String.IsNullOrEmpty(stderr_))
                        {
                            return_value = return_value + (Char)10 + stderr_;
                        }
                    }
                }
                else
                {
                    return_value = String.Empty;
                }
            });
            return return_value;
        }
        public static async Task<bool> HandleFileRequest(HttpListenerContext context)
        {
            bool handled = false;
            string abs_path = context.Request.Url == null ? String.Empty : context.Request.Url.AbsolutePath;
            string RequestFile = $"{home_}/.TEMP/VAR/www" + Uri.UnescapeDataString(abs_path);
            if (File.Exists(RequestFile) & !abs_path.ToLower().Equals("/pixel.gif") & !abs_path.ToLower().Equals("/ebay.gif"))
            {
                if (MimeTypes.GetMimeType(RequestFile).Contains("video") | MimeTypes.GetMimeType(RequestFile).Contains("mpegURL"))
                {
                    await Task.Factory.StartNew(async () =>
                    {
                        await SendVideo(context, RequestFile);
                    });
                    handled = true;
                }
                else
                {
                    await WriteFile(context, RequestFile);
                    handled = true;
                }
            }
            return handled;
        }
