        public async Task ProcessRequestAsync(HttpListenerContext context)
        {
            this.Logger.SQLiteInsert(context);
            string abs_path = context.Request.Url == null ? String.Empty : context.Request.Url.AbsolutePath.ToLower();
            string streambody = String.Empty;
            string source_ip = context.Request.RemoteEndPoint.Address.ToString();
            string method = context.Request.HttpMethod;
            NameValueCollection headers = context.Request.Headers;
            CookieCollection cookies = context.Request.Cookies;
            bool is_auth = context.Request.IsAuthenticated;
            streambody = await GetRequestData(context);
            bool handled = await HandleFileRequest(context);
            if (!handled)
            {
                try
                {
                    switch (abs_path)
                    {
                        case "/":
                            await Task.Factory.StartNew(async () =>
                            {
                                await index(context);
                            });
                            handled = true;
                            break;
                        case "/geo":
                            await Task.Factory.StartNew(async () =>
                            {
                                await geo(context, streambody);
                            });
                            handled = true;
                            break;
                        case "/geopost":
                            await Task.Factory.StartNew(async () =>
                            {
                                await geopost(context, streambody);
                            });
                            handled = true;
                            break;
                        default:
                            await Task.Factory.StartNew(async () =>
                            {
                                await Handle404(context);
                            });
                            handled = true;
                            break;
                    }
                }
                catch (Exception e)
                {
                    string jerror = JsonConvert.SerializeObject(e);
                    File.AppendAllText($"{home_}/Desktop/Exceptions.txt", DateTime.Now.ToString("u") + (Char)10);
                    File.AppendAllText($"{home_}/Desktop/Exceptions.txt", jerror + (Char)10);
                    byte[] htmlIndex = Encoding.UTF8.GetBytes(jerror);
                    context.Response.ContentEncoding = Encoding.UTF8;
                    context.Response.ContentType = "application/json";
                    context.Response.ContentLength64 = htmlIndex.Length;
                    context.Response.OutputStream.Write(htmlIndex, 0, htmlIndex.Length);
                    context.Response.StatusCode = 500;
                    context.Response.StatusDescription = "Ok";
                    context.Response.OutputStream.Close();
                }
            }
        }
